"use strict";(self.webpackChunkway23=self.webpackChunkway23||[]).push([[8593],{41110:(e,t,o)=>{o.r(t),o.d(t,{data:()=>s});const s={key:"v-4711fb79",path:"/%D1%80%D0%B0%D0%B1%D0%BE%D1%82%D0%B0-%D1%81-svn-%D1%87%D0%B5%D1%80%D0%B5%D0%B7-tortoisesvn-2-%D0%BF%D1%80%D0%BE%D1%81%D0%BC%D0%BE%D1%82%D1%80-%D0%B8%D0%B7%D0%BC%D0%B5%D0%BD%D0%B5%D0%BD%D0%B8%D0%B9.html",title:"Работа с SVN через TortoiseSVN. 2. Просмотр изменений, обновление, слияние",lang:"ru-RU",frontmatter:{title:"Работа с SVN через TortoiseSVN. 2. Просмотр изменений, обновление, слияние",date:"2017-01-20",categories:["Системы контроля версий (VCS)"],tags:["svn","tortoisesvn"]},excerpt:"",headers:[{level:2,title:"Просмотр изменений",slug:"просмотр-изменении",children:[]}],filePathRelative:"работа-с-svn-через-tortoisesvn-2-просмотр-изменений.md",git:{updatedTime:1692859375e3}}},49252:(e,t,o)=>{o.r(t),o.d(t,{default:()=>g});var s=o(66252),p=o(3577);const i={id:"frontmatter-title",tabindex:"-1"},r=(0,s._)("a",{class:"header-anchor",href:"#frontmatter-title","aria-hidden":"true"},"#",-1),n=(0,s.Uk)("В "),a={href:"http://way23.ru/%d1%80%d0%b0%d0%b1%d0%be%d1%82%d0%b0-%d1%81-svn-%d1%87%d0%b5%d1%80%d0%b5%d0%b7-tortoisesvn-1-%d0%b2%d1%8b%d0%b3%d1%80%d1%83%d0%b7%d0%ba%d0%b0-%d1%84%d0%b8%d0%ba%d1%81%d0%b0%d1%86%d0%b8%d1%8f/",target:"_blank",rel:"noopener noreferrer"},l=(0,s.Uk)("первой части"),d=(0,s.Uk)(" была описана выгрузка и фиксация в репозиторий. В этой части к работе подключается Вася и вносит новые изменения."),m=(0,s.uE)('<h2 id="просмотр-изменении" tabindex="-1"><a class="header-anchor" href="#просмотр-изменении" aria-hidden="true">#</a> Просмотр изменений</h2><p>Вася точно также как и Петя создает новый каталог и выгружает репозиторий. По умолчанию выгружается последняя ревизия поэтому в рабочей копии Васи сразу появился файл созданный Петей.</p><p>Теперь Вася хочет посмотреть что именно менял Петя в репозитории. Для этого он открывает Журнал, и делает в нем двойном клик на файле который его интересует.</p><p><img src="images/tortoisesvn_12.png" alt="TortoiseSVN журнал"></p><p><img src="images/tortoisesvn_13.png" alt="TortoiseSVN diff"></p><p>Сразу видно что Петя вынес весь код в отдельную функцию. Увидев это Вася решил внести новые изменения в код. Он изменяет файл <code>main.py</code> и фиксирует.</p><p>def hello(name): if name == None: print(&#39;hello!&#39;) else: print(&#39;hello &#39; + name + &#39;!&#39;)</p><p>hello()</p><p><img src="images/tortoisesvn_14.png" alt="TortoiseSVN диалог фиксации"></p><p>Через некоторое время Петя решил проверить состояние репозитория. Для этого он открывает Журнал и видит новую фиксацию Васи</p><p><img src="images/tortoisesvn_15.png" alt="TortoiseSVN журнал"></p><p>Для обновления рабочей копии Петя нажимает Обновить</p><p><img src="images/tortoisesvn_16.png" alt="TortoiseSVN запуск обновления рабочей копии"></p><p><img src="images/tortoisesvn_17.png" alt="TortoiseSVN обновление успешно завершено!"></p><p>Теперь в рабочей копии последняя версия файла <code>main.py</code>. Петя замечает что программа перестала работать, исправляет ошибку и фиксирует файл.</p><p>def hello(name): if name == None: print(&#39;hello!&#39;) else: print(&#39;hello &#39; + name + &#39;!&#39;)</p><p>hello(&#39;Petya&#39;)</p><p><img src="images/tortoisesvn_18.png" alt="TortoiseSVN диалог фиксации"></p><p>Через некоторое время к проекту возвращается Вася и решает добавить новую функцию. Но он забывает обновится перед началом редактирования и изменяет устаревший файл, который не содержит изменений Пети.</p><p>def hello(name): if name == None: print(&#39;hello!&#39;) else: print(&#39;hello &#39; + name + &#39;!&#39;)</p><p>def hello2(name1, name2): hello(name1) hello(name2)</p><p>hello()</p><p>и фиксирует его</p><p><img src="images/tortoisesvn_19.png" alt="TortoiseSVN диалог фиксации"></p><p>фиксация не удается. SVN обнаруживает что Вася не обновился и редактировал старую версию файла.</p><p><img src="images/tortoisesvn_20.png" alt="TortoiseSVN неудачная фиксация"></p><p>Вася нажимает ОК и TortoiseSVN предлагает ему автоматически обновится.</p><p><img src="images/tortoisesvn_21.png" alt="TortoiseSVN диалог обновления перед фиксацией"></p><p>Вася нажимает Обновить. Появляется окно обновления в котором написано что SVN автоматически слил изменения - объединил изменения Пети из репозитория и Васи в рабочей копии в одном файле.</p><p><img src="images/tortoisesvn_22.png" alt="TortoiseSVN обновление "></p><p>После нажатия ОК снова появляется окно фиксации.</p><p><img src="images/tortoisesvn_23.png" alt="TortoiseSVN фиксация"></p><p>В этот раз фиксация Васи проходит удачно.</p><p><img src="images/tortoisesvn_24.png" alt="TortoiseSVN успешная фиксация"></p>',34),g={render:function(e,t){const o=(0,s.up)("OutboundLink");return(0,s.wg)(),(0,s.iD)(s.HY,null,[(0,s._)("h1",i,[r,(0,s.Uk)(" "+(0,p.zw)(e.$frontmatter.title),1)]),(0,s._)("p",null,[n,(0,s._)("a",a,[l,(0,s.Wm)(o)]),d]),m],64)}}}}]);